import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import ButtonToolbar from 'react-bootstrap/Button';
class Letters extends Component {
    constructor(props){
        super(props);
        this.state={
            colorUp: 'primary',
            colorDown: 'secondary',
            clicked: false
        };
        this.changeColor=this.changeColor.bind(this);
    }
    changeColor(event){
        if(this.state.clicked===false){
            this.setState({
                clicked: true
            });
        }
    }
    render(){
        return (
           [<ButtonToolbar>
          <Button variant={this.state.colorUp} onClick={this.changeColor} disabled={this.state.clicked}>A</Button>
          <Button variant={this.state.colorUp}>B</Button>
          <Button variant={this.state.colorUp}>C</Button>
          <Button variant={this.state.colorUp}>D</Button>
          <Button variant={this.state.colorUp}>E</Button>
          <Button variant={this.state.colorUp}>F</Button>
          <Button variant={this.state.colorUp}>G</Button>
          <Button variant={this.state.colorUp}>H</Button>          
          <Button variant={this.state.colorUp}>I</Button> 
          <Button variant={this.state.colorUp}>J</Button> 
          <Button variant={this.state.colorUp}>K</Button>   
          <Button variant={this.state.colorUp}>L</Button> 
          <Button variant={this.state.colorUp}>M</Button>      
          </ButtonToolbar>,
           <ButtonToolbar>
           <Button variant="primary">N</Button>
           <Button variant="primary">O</Button>
           <Button variant="primary">P</Button>
           <Button variant="primary">Q</Button>
           <Button variant="primary">R</Button>
           <Button variant="primary">S</Button>
           <Button variant="primary">T</Button>          
           <Button variant="primary">U</Button> 
           <Button variant="primary">V</Button> 
           <Button variant="primary">W</Button>   
           <Button variant="primary">X</Button>   
           <Button variant="primary">Y</Button>  
           <Button variant="primary">Z</Button>  
           </ButtonToolbar>]
        );
    }
}
export default Letters;
